#[derive(Debug, PartialEq, Eq, Copy, Clone, Default)]
enum Movement {
    #[default]
    Default,
    Water,
}

fn has_movement(ctx: &Context, world: &World, m: Movement) -> bool {
    match m {
        Movement::Default => true,
        Movement::Water => rules::access_underwater_movement(ctx, world),
    }
}

pub type MovementState = [bool; 1];

pub fn get_movement_state(ctx: &Context, world: &World) -> MovementState {
    [rules::access_underwater_movement(ctx, world)]
}

pub fn observe_movement_state(
    ctx: &Context,
    world: &World,
    full_obs: &mut FullObservation,
) -> MovementState {
    [rules::observe_access_underwater_movement(
        ctx, world, full_obs,
    )]
}

